import Rebase from 're-base';
import firebase from 'firebase';

const firebaseApp = firebase.initializeApp({
    apiKey: "AIzaSyDD5wnVcVk11Shz37Jsizwi0GS0hNQQVt0",
    authDomain: "catch-of-the-day-joe-castle.firebaseapp.com",
    databaseURL: "https://catch-of-the-day-joe-castle.firebaseio.com"
  });

  const base = Rebase.createClass(firebaseApp.database());

  // This is a named export
  export { firebaseApp };

  // This is a default export
  export default base;
